@J. Z. Look dude, the Russians fly right up against our airspace borders all the time. Daily. Literally. We don't limit international waters navigation. Vessels from all over the world come to fish waters right up next to our boundaries all the time. The Chinese fish extensively near our international boundaries. We don't lose our minds. We respect the law. 

The CCP is attempting to impede lawful navigation. That's illegal. And for as long as they play this game, the US Navy and the US Air Force will push back on them, and patrol those waters and that airspace. 

There's no hypocrisy. Just the law.

