@William Wallace Also WW1. The last president, in his effort to finally begin the upgrade of our military found out that we have been buying outdated weapons from the US. An insult to our alliance that was a result of connivance and corruption of whoever were in charge of purchasing in both countries. So we ended up buying from France, Russia, India and Turkey. In the end we both lost out. This fueled anti-US sentiments in some. 

Politicians may sprout their narratives but   our long history of fighting side by side and with it, our sense of kinship with the Americans had already taken root. Filipinos are emotional and all about the family. They are also willing to fight and even in street brawls, they would say "walang iwanan" (no one gets left behind). When you combine these aspects, it would mean that they perceive Americans as brothers in arms, friends who helped defend their families, they become family who will not leave each other behind in battle. There is also the sense of gratitude that they would distort to make us into a vassal of the US. Other countries will not understand because of differences in culture and cultural values. 

During the Korean war, way back when men were noble, our then president sent his only son to fight since he couldn't be there. His son was a pilot of a fighter plane. Because of family, kinship and brotherhood, his only son in law also volunteered. Because we are emotional like that. . . I appreciate your regard for our people. Thank you brother!

